" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   E. coli asparaginase: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?38/37/39508?source=see_link\">",
"    see \"E. coli asparaginase: Patient drug information\"",
"   </a>",
"   and",
"   <a class=\"drug drug_pediatric\" href=\"UTD.htm?16/1/16405?source=see_link\">",
"    see \"E. coli asparaginase: Pediatric drug information\"",
"   </a>",
"   )",
"   <br/>",
