"   <div class=\"block doa drugH1Div\" id=\"F137004\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to individual protocols.",
"     <b>",
"      Note:",
"     </b>",
"     Dose, frequency, number of doses, and start date may vary by protocol and treatment phase.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      ALL:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      I.V.:",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     6000 units/m",
"     <sup>",
"      2",
"     </sup>",
"     /dose 3 times/week for ~6-9 doses",
"     <b>",
"      or",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     1000 units/kg/day for 10 days",
"     <b>",
"      or",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     High-dose therapy (unlabeled dose): 10,000 units/m",
"     <sup>",
"      2",
"     </sup>",
"     /day for ~3-12 doses",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Single-agent therapy (rare): 200 units/kg/day for 28 days",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     <i>",
"      I.M.:",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     6000 units/m",
"     <sup>",
"      2",
"     </sup>",
"     /dose 3 times/week for ~6-9 doses",
"     <b>",
"      or",
"     </b>",
"     6000 units/m",
"     <sup>",
"      2",
"     </sup>",
"     /dose every ~3 days for ~6-9 doses",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     High-dose therapy (unlabeled dose): 10,000 units/m",
"     <sup>",
"      2",
"     </sup>",
"     /day for ~3-12 doses",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     <b>",
"      Test dose:",
"     </b>",
"     A test dose is often recommended prior to the first dose of asparaginase, or prior to restarting therapy after a hiatus of several days. Most commonly, 0.1 mL of a 20 units/mL (2 units) asparaginase dilution is injected intradermally, and the patient observed for at least 1 hour. False-negative rates of up to 80% to test doses of 2-50 units are reported.",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     Some practitioners recommend an asparaginase desensitization regimen for patients who react to a test dose, or are being retreated following a break in therapy. Doses are doubled and given every 10 minutes until the total daily dose for that day has been administered. One schedule begins with a total of 1 unit given I.V. and doubles the dose every 10 minutes until the total amount given is the planned dose for that day. For example, if a patient was to receive a total dose of 4000 units, he/she would receive injections 1 through 12 during the desensitization. See table.",
