var title_f10_20_10572="Dx criteria for cutaneous and systemic mastocytosis";
var content_f10_20_10572=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F82827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F82827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for cutaneous and systemic mastocytosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Cutaneous mastocytosis (CM)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Skin lesions demonstrating the typical clinical findings of urticaria pigmentosa/maculopapular cutaneous mastocytosis, diffuse cutaneous mastocytosis or solitary mastocytoma, and typical histological infiltrates of mast cells in a multifocal or diffuse pattern in an adequate skin biopsy. In addition, a diagnostic prerequisite for the diagnosis of CM is the absence of features/criteria sufficient to establish the diagnosis of SM.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Systemic mastocytosis (SM)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The diagnosis of SM can be made when the major criterion and one minor criterion or at least three minor criteria are present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Major criterion:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multifocal, dense infiltrates of mast cells (&ge;15 mast cells in aggregates) detected in sections of bone marrow and/or other extracutaneous organ(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Minor criteria:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <ol>",
"         <li>",
"          In biopsy sections of bone marrow or other extracutaneous organs, &gt;25 percent of the mast cells in the infiltrate are spindle-shaped or have atypical morphology or, of all mast cells in bone marrow aspirate smears, &gt;25 percent are immature or atypical",
"         </li>",
"         <li>",
"          Detection of an activating point mutation at codon 816 of",
"          <em>",
"           KIT",
"          </em>",
"          in bone marrow, blood or another extracutaneous organ",
"         </li>",
"         <li>",
"          Mast cells in bone marrow, blood or other extracutaneous organs express CD2 and/or CD25 in addition to normal mast cell markers",
"         </li>",
"         <li>",
"          Serum total tryptase persistently exceeds 20 ng/mL (unless there is an associated clonal myeloid disorder, in which case this parameter is not valid)",
"         </li>",
"        </ol>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     <p>",
"      &nbsp;",
"     </p>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Horny HP, Metcalfe DD, Bennet JM, et al. Mastocytosis. In: WHO classification of tumours of haematopoietic and lymphoid tissues, 4th ed, Swerdlow SH, Camp E, Harris NL, et al (Eds), IARC, Lyon 2008. Copyright &copy; 2008.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
