" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 521px\">",
"   <div class=\"ttl\">",
"    Relative survival for 2856 Merkel cell carcinoma patients by stage",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 501px; height: 306px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relative survival for 2856 Merkel cell carcinoma patients by stage. Percent relative survival was calculated for cases in the National Cancer Database using age- and sex-matched control data from the Centers for Disease Control and Prevention. Stages are indicated in the figure except for Stage IIIA* which could not be derived using this dataset. Total number of patients with 2856, and individual substages were as follows: IA = 266, IB = 754, IIA = 124, IIB = 414, IIC = 84, IIIA = 794, IIIB = 143, IV = 277.",
"    <div class=\"footnotes\">",
"     * The IIIA curve shown represents pathologically node positive patients, with the clinical node status unknown or negative. It is anticipated that true Stage IIIA patients (clinical node status negative) have better survival than the IIIA line in this graph shows.",
"    </div>",
"    <div class=\"reference\">",
